INSERT INTO fashion_ecommerce.products (product_id, cost_price, current_quantity, description, image, is_activated, is_deleted, name, sale_price, category_id) VALUES (25, 350, 900, '? CHẤT LIỆU

 Chất đũi mềm mát, thấm hút mồ hôi, an toàn với làn da bé. 

 ? MÀU SẮC

Váy có màu trắng sữa, mềm mát nhưng không lộ. Váy trắng tôn da, rất bắt ảnh khi chụp hình.

? KIỂU DÁNG

Váy dáng xoè rộng phía dưới, có phần ngực cảnh tiên, tay bo chun. Phía sau là ba cúc chaỵ dọc xuống lưng, rất dễ dàng cho bé mặc màu hè này. Váy trắng tôn da bé mặc lên như những thiên thần của mẹ. 

